import axios from "axios";
import { useEffect } from "react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";

function Card(props) {
  useEffect(() => {
    props.dispatch({
      type: "GET_MOVIES_DETAIL",
    });
  }, []);
  return (
    <div className="play-list-section mt-3 ml-4 mr-4">
      {props.getMoviesDetail?.length > 0 &&
        props.getMoviesDetail.map((each, index) => {
          console.log(each);
          return (
            <div className="card">
              <img src={"./video_banner/"+each.replace('.mp4', '')+".jpg"} className="card-img-top" alt={each.replace('.mp4', '')} />
              <div className="card-body">
                <h5 className="card-title">Card title</h5>
                <p className="card-text">
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </p>
                <a href="#" className="btn btn-primary">
                  Play
                </a>
              </div>
            </div>
          );
        })}
    </div>
  );
}
Card = withRouter(Card);
export default connect(function (state, action) {
  return {
    getMoviesDetail: state?.get_detail,
  };
})(Card);
